/** Model representing a timesheet time period instance. A time period is uniquely identified by the timePeriodKey and beginDate fields. */
export class TimePeriodModel {
  /**
   * Time period setup ID
   * @format int64
   * @min 1
   * @example 1
   */
  timePeriodKey: number | null = null;
  /**
   * Time period begin date
   * @format date
   * @pattern ^[1-2]\d{3}-\d{2}-\d{2}$
   */
  beginDate: string | null = null;
  /**
   * Time period end date
   * @format date
   * @pattern ^[1-2]\d{3}-\d{2}-\d{2}$
   */
  endDate?: string;
  /** This field will determine the default value for all new time periods of this type, as to whether end users can create timesheet adjustments for a particular time period. This is simply the default value.  */
  allowUserAdjustments?: boolean;
  /** This field will control whether additional timesheets can be created for a particular time period. This may be useful if you would like to 'close out' a past period to be sure no new timesheets are added to the system for that period. This feature can be used alone or in conjunction with the 'cutOffDate' and/or maxFuturePeriods fields (configured by Time Period Setup resource) to limit the entry of timesheets. */
  allowNewTimesheets?: boolean;
  /**
   * When a user deletes a timesheet in Unanet, the standard behavior is to evaluate if any other timesheets exist for that time period, and if not, that time period will be removed (in an effort to keep the database clear of any unnecessary entries).
   *
   * When creating custom time periods, however, the Administrator can ensure that these special shortened or lengthened time periods remain even if no timesheets exist so that when a user does attempt to create a timesheet for that time period -- the custom period definition will be available.
   *
   * Thus, this setting is likely only needed for use in conjunction with non-standard/custom time period entries.
   */
  preventAutoRemoval?: boolean;
  /**
   * This feature can be used to limit edit, delete or approval access to timesheets for a particular time period, to only those users having an administrative role (Administrator or HRAdministrator).
   *
   * When enabled for a time period, the ability to edit or delete or approve will be unavailable for non administrative users for those time periods.  Regular end users will be able to continue to access other time periods not currently limited by this feature.  Administrative users that could otherwise access timesheets or approvals will still have access to the timesheets in this time period to make changes as necessary.
   *
   * This feature may be useful should you desire to shut down access during your end of period processing window.
   *
   *
   * Do note that while this feature prevents users from further manipulating their timesheets, other activities such as the update of person rates, labor category rates or assignment changes will continue to have the ability to modify non-EXTRACTED or non-LOCKED timesheets.
   */
  adminOnlyAccess?: boolean;
  /**
   * This field allows you to define the standard number of hours available for this type of time period. For weekly and bi-weekly time periods, this number defaults to 40 and 80 hours respectively.
   * Note that making changes to the value will only impact timesheets created after the change has been saved, that is, it will not impact any existing timesheets (they will continue to have the previously defined 'hoursInPeriod' value).
   *
   * The value in this field will be used in the Dilution calculations (if your site is configured to use dilution), unless you have specified the Use Business Week Hours for Dilution (unatime.dilution_hours_from_business_week) property (which indicates dilution should be calculated based on business week hours).  Should you need to override the work hours for dilution purposes on existing timesheets, you can do so on a timesheet by timesheet basis.
   * @format double(13, 4)
   * @min 0
   * @exclusiveMin true
   * @example 123.45
   */
  hoursInPeriod: number | null = null;
  /** Is this an existing time period?  Value will be true for existing time periods and false for projected time periods that are yet to be created. */
  existing?: boolean;

  public constructor(init?: Partial<TimePeriodModel>) {
    Object.assign(this, init);
  }
}

