  /**
   * Time period cut off date. It is intended to be used to limit the entry of future timesheets.  By default, this field is not populated which equates to no limit. This field may be useful if you would like to prevent users from accidentally creating timesheets beyond a specific date depending on your policy (e.g. if you would like to prevent users from entering data beyond the current quarter or year).
   *
   * This field will be used to prevent the entry of a timesheet having an end date greater than this cut off date. This feature can be used alone or in conjunction with the maxFuturePeriods' field as well as the 'TimePeriodModel.allowNewTimesheets' field to limit the entry of timesheets. This feature does not prevent Administrators from creating future time periods, but rather is only enforced where end users create new timesheets (thus, these restrictions do not impact Time Import or Time Populate administrative functionality).
   * @format date
   * @pattern ^[1-2]\d{3}-\d{2}-\d{2}$
   */
  cutOffDate: string | null = null;
  /** Is this time period enabled? */
  enabled?: boolean;
  /** This field will determine the default value for all new time periods of this type, as to whether end users can create timesheet adjustments for a particular time period. This is simply the default value. If your location is using the end user adjustment feature, you can also enable/disable adjustments for individual time periods. */
